import React from 'react';

var dateFormat = require("dateformat");

const Tweet = ({tweets}) => (

    <>
        <div className="grid-container">
            <div className="cell5">
            {tweets.map((thistweet, key) => 
                <div key={key} className="tweet-style1">
                    <img src={thistweet.user.profile_image_url} alt="not found" className="tweet-img"/>
                    <span className="tweet-style3">{thistweet.user.screen_name}</span>
                    <span className="tweet-style2">@{thistweet.user.name}</span>
                    <p className="tweet-style2">{dateFormat(thistweet.created_at, "dddd, mmmm dS, yyyy, h:MM:ss TT")}</p>
                    <p>{thistweet.text}</p>    
                </div>   
            )}
            </div>
        </div> 
    </>
)

export default Tweet;
